import React from 'react'
import ReactDOM from 'react-dom'

function Contactcard(props){
    //console.log(props)
    if(props.joke.question != undefined && props.joke.punchline != undefined){
        ReactDOM.render(<h3>Question: {props.joke.question}</h3>, document.getElementById('jokes'));
        ReactDOM.render( <h3>Punchline: {props.joke.punchline}</h3>, document.getElementById('jokes'));
    }else if(props.joke.question == undefined){
        ReactDOM.render( <h3>Punchline: {props.joke.punchline}</h3>, document.getElementById('jokes'));
    }else if(props.joke.question == undefined){
        ReactDOM.render(<h3>Question: {props.joke.question}</h3>, document.getElementById('jokes'));
    }
    return(
        <div className='jokes'>
        </div>

    )
}


export default Contactcard
